        *faktor2=produkt;
	else {
        int zahl = produkt/2;
        while(produkt % zahl !=0) zahl-=1;
        *faktor1 = zahl;
        *faktor2 = produkt/zahl;
}
    long produkt;
    long faktor1;
    long faktor2;
	scanf("%ld",&produkt);
    factorize (produkt, &faktor1, &faktor2);
	printf("Possible Factors of %ld are %ld and %ld.\n",produkt,faktor1,faktor2);
